$(document).ready(function() {
  $('.js-lazy-load').each(function() {
    if ($(this).data('type') == 'background-image') {
      $(this).css('background-image', 'url(' + $(this).data('src') + ')')
    } else if ($(this).data('type') == 'image') {
      $(this).css('src', $(this).data('src'))
    }
  });

  $('.js-dropdown').each(function() {
    var dropdown = $(this);
    // dropdown.find('.js-control-show-dropdown').on('click', function() {
    //   if (dropdown.hasClass('show')) return dropdown.removeClass('show');
    //   dropdown.addClass('show');
    // });
    // $(document).on('click', function(e) {
    //   if (!$(e.target).closest(dropdown).length) {
    //     dropdown.removeClass('show')
    //   }
    // })
  });

  $('.js-toggle-control').on('click', function() {
    // var toggleWrap = $(this).closest('.js-toggle');
    // if (toggleWrap.hasClass('show')) return toggleWrap.removeClass('show');
    // toggleWrap.addClass('show');
  });

  $('.js-tab').each(function() {
    var tab = $(this);
    var tabNavItem = $(this).find('.js-tab-nav');
    var tabContentItem = $(this).find('.js-tab-content-item');
    tab.find('.js-tab-nav').on('click', function() {
      tabNavItem.removeClass('active');
      tabContentItem.removeClass('active');
      $(this).addClass('active');
      tab.find($(this).data('target')).addClass('active');
    });
  });

  var slider = function(slider, option) {
    slider.css('display', 'block');
    var sliderWrap = slider.find('.slider__list-wrap');
    var sliderList = slider.find('.slider__list');
    var sliderWrapWidth = sliderWrap.outerWidth();
    var sliderItem = slider.find('.slider__item');
    var btnPrev = slider.find('.js-prev-slide');
    var btnNext = slider.find('.js-next-slide');
    var firstShowSlide;
    var currentSlide;

    if (option) {
      if (option.reponsive.desktop && $(window).width() <= 1199.98) {
        option.number = option.reponsive.desktop
      } else if (option.reponsive.tablet && $(window).width() <= 991.98) {
        option.number = option.reponsive.tablet
      } else if (option.reponsive.phone && $(window).width() <= 767.98) {
        option.number = option.reponsive.phone
      } else if (option.reponsive.xs && $(window).width() <= 575.98) {
        option.number = option.reponsive.xs
      }
    }
    if (option && option.number && option.number > 1) {
      sliderItem.width(sliderWrapWidth / option.number);
      sliderList.width(sliderWrapWidth * sliderItem.length / option.number);
      if (option.activeSlide) {
        $(sliderItem[ option.activeSlide ]).addClass('active');
        if ($(sliderItem[ option.activeSlide - 1 ])) {
          $(sliderItem[ option.activeSlide - 1 ]).addClass('prev-active')
        }
        if ($(sliderItem[ option.activeSlide + 1 ])) {
          $(sliderItem[ option.activeSlide + 1 ]).addClass('next-active')
        }
        firstShowSlide = Math.floor((option.activeSlide + 1) / option.number) * option.number;
        sliderList.css({
          'transform': 'translateX(-' + sliderWrapWidth * firstShowSlide / option.number + 'px)'
        });
        btnPrev.on('click', function() {
          if (firstShowSlide > 0) {
            sliderList.css({
              'transform': 'translateX(-' + sliderWrapWidth * (firstShowSlide - 1) / option.number + 'px)'
            });
            firstShowSlide--;
          }
        });
        btnNext.on('click', function() {
          if (firstShowSlide + option.number < sliderItem.length) {
            sliderList.css({
              'transform': 'translateX(-' + sliderWrapWidth * (firstShowSlide + 1) / option.number + 'px)'
            });
            firstShowSlide++;
          }
        });
      } else {
        currentSlide = 0;
      }
    } else {
      sliderItem.width(sliderWrapWidth);
      sliderList.width(sliderWrapWidth * sliderItem.length);
      if (option && option.activeSlide) {
        currentSlide = option.activeSlide;
      } else {
        currentSlide = 0
      }
      sliderList.css({
        'transform': 'translateX(-' + sliderWrapWidth * currentSlide + 'px)'
      });
      $(sliderItem[ currentSlide ]).addClass('active');
      btnPrev.on('click', function() {
        if (currentSlide > 0) {
          sliderList.css({
            'transform': 'translateX(-' + sliderWrapWidth * (currentSlide - 1) + 'px)'
          });
          currentSlide--;
        }
      });
      btnNext.on('click', function() {
        if (currentSlide < sliderItem.length - 1) {
          sliderList.css({
            'transform': 'translateX(-' + sliderWrapWidth * (currentSlide + 1) + 'px)'
          });
          currentSlide++;
        }
      });
    }
  }

  slider($('.review .js-slider'));

  $('.js-toggle-modal').on('click', function() {
    // $('body').addClass('show-modal');
    // $($(this).data('target')).addClass('show');
  });
  $(document).on('click', function(e) {
    // if (!$(e.target).closest('.modal-content').length && !$(e.target).closest('.js-toggle-modal').length && !$(e.target).closest('.modal-popup').length) {
    //   $('.modal').removeClass('show');
    //   $('body').removeClass('show-modal');
    // }
  });

  $('select').on('mousedown', function(e) {
    e.preventDefault()
  });

  $('.js-menu-mobile').on('click', function() {
    $('body').addClass('show-menu')
  });
  $('.js-close-menu-mobile').on('click', function() {
    $('body').removeClass('show-menu')
  });

  $('.datepicker').datepicker();

  $(window).on('scroll', function() {
    if ($('.header-search-page')) {
      if (window.width >= 768) {
        if (window.scrollY > 100) {
          $('.header-search-page').addClass('on-change');
        } else {
          $('.header-search-page').removeClass('on-change');
        }
      } else {
        if (window.scrollY > 70) {
          $('.header-search-page').addClass('on-change');
        } else {
          $('.header-search-page').removeClass('on-change');
        }
      }
    }
  });

  if ($('.js-block-countdown').length) {
    var blockCountdownWidth = $('.js-block-countdown').outerWidth();
    if ($(document).scrollTop() >= $('.js-block-countdown').offset().top - 83) {
      $('.js-block-countdown').css('width', blockCountdownWidth);
      $('.js-block-countdown').addClass('fixed');
    }
    $(document).on('scroll', function() {
      if ($(this).scrollTop() >= 198) {
        $('.js-block-countdown').css('width', blockCountdownWidth);
        $('.js-block-countdown').addClass('fixed')
      } else if ($(this).scrollTop() < 198) {
        $('.js-block-countdown').removeClass('fixed')
      }
    });
  }

  /* eslint-disable */
  // Create Countdown
  var Countdown = {
    // Backbone-like structure
    $el: $('.countdown'),
    // Params
    countdown_interval: null,
    total_seconds     : 0,

    // Initialize the countdown
    init: function() {
      // DOM
      this.$ = {
        minutes: this.$el.find('.bloc-time.min .figure'),
      };

      this.values = {
        minutes: 120,
        seconds: 0,
      };

      this.total_seconds = this.values.minutes * 60
      // Animate countdown to the end
      this.count();
    },

    count: function() {
      var that    = this,
          $min_1  = this.$.minutes.eq(0),
          $min_2  = this.$.minutes.eq(1),
          $min_3  = this.$.minutes.eq(2);

      this.countdown_interval = setInterval(function() {
        if(that.total_seconds > 0) {
          --that.values.seconds;
          if(that.values.minutes >= 0 && that.values.seconds < 0) {
            that.values.seconds = 59;
            --that.values.minutes;
          }
          that.checkHour(that.values.minutes, $min_1, $min_2, $min_3);
          --that.total_seconds;
        }
        else {
          clearInterval(that.countdown_interval);
        }
      }, 1000);
    },

    animateFigure: function($el, value) {
      var that         = this,
          $top         = $el.find('.top'),
          $bottom      = $el.find('.bottom'),
          $back_top    = $el.find('.top-back'),
          $back_bottom = $el.find('.bottom-back');

      // Before we begin, change the back value
      $back_top.find('span').html(value);

      // Also change the back bottom value
      $back_bottom.find('span').html(value);

      // Then animate
      TweenMax.to($top, 0.8, {
        rotationX           : '-180deg',
        transformPerspective: 300,
        ease                : Quart.easeOut,
        onComplete          : function() {
          $top.html(value);
          $bottom.html(value);
          TweenMax.set($top, { rotationX: 0 });
        }
      });

      TweenMax.to($back_top, 0.8, {
        rotationX           : 0,
        transformPerspective: 300,
        ease                : Quart.easeOut,
        clearProps          : 'all'
      });
    },

    checkHour: function(value, $el_1, $el_2, $el_3) {
      var val_1       = value.toString().charAt(0),
          val_2       = value.toString().charAt(1),
          val_3       = value.toString().charAt(2),
          fig_1_value = $el_1.find('.top').html(),
          fig_2_value = $el_2.find('.top').html(),
          fig_3_value = $el_3.find('.top').html();
      if(value >= 100) {
        // Animate only if the figure has changed
        if(fig_1_value !== val_1) this.animateFigure($el_1, val_1);
        if(fig_2_value !== val_2) this.animateFigure($el_2, val_2);
        if(fig_3_value !== val_3) this.animateFigure($el_3, val_3);
      }
      else if (value >= 10) {
        if(fig_1_value !== '0') this.animateFigure($el_1, 0);
        if(fig_2_value !== val_1) this.animateFigure($el_2, val_1);
        if(fig_3_value !== val_2) this.animateFigure($el_3, val_2);
      }
      else {
        // If we are under 10, replace first figure with 0
        if(fig_1_value !== '0') this.animateFigure($el_1, 0);
        if(fig_2_value !== '0') this.animateFigure($el_2, 0);
        if(fig_3_value !== val_1) this.animateFigure($el_3, val_1);
      }
    }
  };

  Countdown.init()
  /* eslint-enable */

  $('.js-slideToggle').on('click', function() {
    $('.slideToggleContent').fadeOut(0);
    $($(this).data('target')).fadeIn(300)
  });

  $('.js-change-info-search').on('click', function() {
    $('html, body').animate({scrollTop: $('.form-search').offset().top - 80}, 600);
  });
});
